    // const classes = useStyles();
    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(getMovies());
    }, [dispatch]);

    return (
        <Container maxWidth="lg">
            <Navbar/>
            {/* <Grow in > */}
            {/* <Container> */}
                <Movies />
            {/* </Container> */}
            {/* </Grow> */}
        </Container>
    )
}

export default App;
